import React, { useState } from "react";
import "./App.css";
import Home from "./views/Home";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { Event, Map, EventModal } from "./components/index";

function App() {
  const [show, setShow] = useState(false);

  const handleShow = () => {
    setShow(true);
  };
  const handleClose = () => {
    setShow(false);
  };

  return (
    <div>
      <Router>
        <Switch>
          <Route
            path="/event"
            exact
            component={Event}
          />
          <Route
            path="/"
            exact
            component={Home}

          />
        </Switch>
      </Router>
      <Map show={show} handleClose={handleClose} handleShow={handleShow} />
      <EventModal
        show={show}
        handleClose={handleClose}
        handleShow={handleShow}
      />
    </div>
  );
}

export default App;
